var list = JSON.parse(json);
var keys = [];
for (var key in list) {
    keys.push(key);
    $("#select").append(new Option(key, key));
}
$.notify.defaults( {elementPosition:'top center', autoHideDelay: 2000} )

var currentCard;
var cardRevealed = false;
var correctCount = 0;
var attemptCount = 0;
var correctRatio = "0/0 Correct";

function randomize(){
    randomIndex = Math.floor(Math.random()*keys.length);
    randomKey = keys[randomIndex];
    randomCard = list[randomKey];
    currentCard = randomCard;
    currentCard.name = randomKey;
    document.getElementById("cardImage").src = '//i.imgur.com/Xqc7rvl.png';
    document.getElementById("pSound").src = currentCard.play;
    document.getElementById("aSound").src = currentCard.attack;
    document.getElementById("dSound").src = currentCard.death;
    $.notify($("#cardImage"),"New Card", "info", {position:'right top'});
    $("#correctText").text(correctRatio);
    cardRevealed = false;
    };

function playSound(){
    document.getElementById("pSound").play();
}
function attackSound(){
    document.getElementById("aSound").play();
}
function deathSound(){
    document.getElementById("dSound").play();
}

function reveal(){
    if (!cardRevealed){
        cardRevealed = true;
        attemptCount +=1;
        document.getElementById("cardImage").src = currentCard.image;
        if ($("#select").val() === currentCard.name){
            correctCount +=1;
            $.notify($("#select"),"correct", "success");
        }
        else{
            $.notify($("#select"),"wrong", "error");
        }
        correctRatio = ""+correctCount+" / " + attemptCount + " Correct";
        console.log(correctRatio);
        $("#correctText").text(correctRatio);
    }
}

function cardClick(){
    if(cardRevealed){
        randomize();
    }
    else{
        reveal()
    };
}

function randomSound(){
    //just gimme  a random sound
    randomIndex = Math.floor(Math.random()*keys.length);
    randomKey = keys[randomIndex];
    randomCard = list[randomKey];
    randomCard.name = randomKey;
    possibleSounds = [randomCard.play, randomCard.attack, randomCard.death]
    randSoundIndex = Math.floor(Math.random()*3)
    document.getElementById("rSound").src = possibleSounds[randSoundIndex];
    document.getElementById("rSound").play();
    soundType = ["Play", "Attack", "Death"][randSoundIndex];
    $.notify($("#random"),randomCard.name +" : "+ soundType, "info");
}
